import React, { useState, useEffect } from 'react';
import axios from 'axios';

function UserDetailPage({ match }) {
  const [user, setUser] = useState(null);

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const userId = match.params.userId;
        const res = await axios.get(`http://localhost:3005/users/${userId}`);
        setUser(res.data);
        console.log(res.data);

      } catch (err) {
        console.error(err);
      }
    };

    fetchUser();
  }, [match.params.userId]);

  if (!user) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>User Details</h1>
      <p>Full Name: {user.fullName}</p>
      <p>Date of Birth: {user.dateOfBirth}</p>
      <p>Address: {user.address}</p>
      <p>Phone Number: {user.phoneNumber}</p>
      <p>Email Address: {user.emailAddress}</p>
      <p>Employment Details: {user.employmentDetails}</p>
      <p>Banking Information: {user.bankingInformation}</p>
      <p>Credit History: {user.creditHistory}</p>
      <p>Assets and Liabilities: {user.assetsAndLiabilities}</p>
      <p>Marital Status: {user.maritalStatus}</p>
      <p>Unique Number: {user.uniqueNumber}</p>
    </div>
  );
}

export default UserDetailPage;
